import styles from "./Navbar.module.css";

const Navbar = (props) => {
    return(
    <div className={styles.nav}>
        <h2>Shibu.co</h2>
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Contact</a>
    </div>
    );
};

export default Navbar;
